import { BrowserRouter, Route, Routes } from "react-router-dom";
import App from "./App";
import Bike from "./Bikes"
const Navigation = () => {
  return <BrowserRouter>
    <Routes>
    <Route path="/" element={<App />}></Route>
    <Route path="/bikes" element={<Bikes />}></Route>
    </Routes>
  </BrowserRouter>;
};
export default Navigation;
